import React from 'react'
import { NavLink } from 'react-router-dom'

import '../../styling/Menu.css'

const Menu = props => {

  var show = 'hide'

  if (props.show) {
    show = 'show'
  }

  return (
    <div id='flyout-menu' className={show} onMouseDown={props.handleMouseDown}>
      <h2>Home</h2>
      <h2>Sign In</h2>
    </div>
  )
}

export default Menu
